import React from 'react';
import classes from './posts-page.module.css';
import Post from '../post/post';
import { Contextt } from '../../app2';

export default () => {
    return (
        <Contextt.Consumer>
            {(obj) => { obj.posts.map((v) => <Post author={v.author}/>)}}
        </Contextt.Consumer>
    );
}

<div className={classes.posts}>
                <h1>POSTS</h1>
                <Contextt.Provider value={this.state.posts}>
                    <Postspage/>
                </Contextt.Provider>
            </div>
